import {
  IonCard,
  IonCardContent,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
  IonContent,
  IonHeader,
  IonIcon,
  IonItem,
  IonLabel,
  IonList,
  IonListHeader,
  IonPage,
  IonTitle,
  IonToolbar,
  IonGrid,
  IonRow,
  IonText,
  IonCol,
  IonItemDivider
} from '@ionic/react';
import { sunny, umbrella, rainy, thunderstorm, cloud } from 'ionicons/icons';
import React, { useState, Component, Props } from 'react';

const Tab2: React.FC = () => {
  const [count, setCount] = useState();
  fetch('api.openweathermap.org/data/2.5/weather?lat=-31.6291409&lon=-60.71936410000001&APPID=7cf1d03c7aab53b9a719411f7a699cef')
  .then(res => setCount(res.json()))
  return (
   <IonPage><IonContent>{count}</IonContent></IonPage>
  );
};

export default Tab2;
